static inline __attribute__((always_inline)) uint16_t long2para(uint32_t size) {
 if (size>0xFFFF0) return 0xffff;
 if (size&0xf) return (uint16_t)((size>>4)+1);
 else return (uint16_t)(size>>4);
}


static inline __attribute__((always_inline)) uint16_t DOS_PackTime(uint16_t hour,uint16_t min,uint16_t sec) {
 return (hour&0x1f)<<11 | (min&0x3f) << 5 | ((sec/2)&0x1f);
}

static inline __attribute__((always_inline)) uint16_t DOS_PackDate(uint16_t year,uint16_t mon,uint16_t day) {
 return ((year-1980)&0x7f)<<9 | (mon&0x3f) << 5 | (day&0x1f);
}
