bool CDROM_Interface_SDL::SetDevice(char* path, int forceCD) {
    int num = SDL_CDNumDrives();
    if ((forceCD >= 0) && (forceCD < num)) {
        driveID = forceCD;
        cd = SDL_CDOpen(driveID);
        SDL_CDStatus(cd);
        return true;
 }
 for (int i=0; i < num; i++) {
        const char* cdname = SDL_CDName(i);
        if (strcasecmp(path, cdname) == 0) {
            cd = SDL_CDOpen(i);
            SDL_CDStatus(cd);
            driveID = i;
            return true;
        }
    }
    return false;
}

